    <h1>Anuel AA</h1><br>

    <div class>
        <p>
           Anuel AA, cuyo nombre real es Emmanuel Gazmey Santiago, es un cantante y compositor puertorriqueño de música urbana. Nació el 27 de noviembre de 1992 en Carolina, Puerto Rico.
           Anuel, se crió en las calles de Puerto Rico y destacó en la escena del trap gracias a canciones como Esclava, que revolucionarón por completo el género urbano.
           El 3 de abril de 2016 Enmanuel fue detenido por cagos de posesión ílicita de armas de fuego, en mayo de 2018 recuperó su libertad y poco antes de salir sacaría su album debut Real Hasta la Muerte
        </p>
